import React, { useState, useEffect, useCallback } from "react";

const NewsFeed = ({ searchQuery }) => {
  const [news, setNews] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [page, setPage] = useState(1);
  const [displayedQuery, setDisplayedQuery] = useState("");
  const pageSize = 10; // Fetch 10 articles at a time

  // Reset news and page when searchQuery changes
  useEffect(() => {
    console.log("Search query changed in NewsFeed:", searchQuery);
    setDisplayedQuery(searchQuery);
    setNews([]);
    setPage(1);
    if (searchQuery && searchQuery.trim() !== "") {
      fetchNewsWithSearch(searchQuery, 1);
    } else {
      fetchNews(1);
    }
  }, [searchQuery]);

  // ✅ Fix: Fetch general news
  const fetchNews = useCallback(async (pageNum = page) => {
    setLoading(true);
    setError(null);

    try {
      const apiUrl = `http://127.0.0.1:8000/news`;

      console.log("Fetching general news from:", apiUrl);
      const response = await fetch(apiUrl);
      const data = await response.json();

      
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  }, [page, pageSize]);

  // ✅ Fix: Fetch news with search query
  // const fetchNewsWithSearch = useCallback(async (query, pageNum = page) => {
  //   if (!query || query.trim() === "") return;
    
  //   setLoading(true);
  //   setError(null);

  //   try {
  //     const apiUrl = `http://127.0.0.1:8000/news`;

  //     console.log("Fetching news with search query:", apiUrl);
  //     const response = await fetch(apiUrl);
  //     const data = await response.json();

  //     if (data.articles) {
  //       setNews(prevNews => (pageNum === 1 ? data.articles : [...prevNews, ...data.articles]));
  //     } else {
  //       throw new Error("No articles found.");
  //     }
  //   } catch (err) {
  //     setError(err.message);
  //   } finally {
  //     setLoading(false);
  //   }
  // }, [page, pageSize]);

  // ✅ Fix: Load more news
  const handleLoadMore = () => {
    const newPage = page + 1;
    setPage(newPage);
    
    if (searchQuery && searchQuery.trim() !== "") {
      fetchNewsWithSearch(searchQuery, newPage);
    } else {
      fetchNews(newPage);
    }
  };

  const styles = {
    container: { padding: "20px" },
    heading: { color: "#00ff88", fontSize: "28px", marginBottom: "24px" },
    searchInfo: { color: "#00ff88", marginBottom: "20px" },
    loadingText: { color: "#00ff88" },
    errorText: { color: "#ff4444" },
    noResultsText: { color: "#ff4444" },
    newsList: { listStyleType: "none", padding: 0 },
    newsItem: { marginBottom: "20px", backgroundColor: "#1a1a1a", padding: "16px", borderRadius: "12px" },
    newsTitle: { color: "#ffffff", fontSize: "18px" },
    newsDescription: { color: "#b3b3b3", fontSize: "14px" },
    newsLink: { color: "#00ff88", textDecoration: "none", fontWeight: "bold" },
    loadMoreButton: { 
      backgroundColor: "#00ff88", 
      color: "#000", 
      padding: "12px 24px", 
      borderRadius: "8px", 
      cursor: "pointer", 
      border: "none", 
      fontWeight: "bold" 
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>Latest News</h2>
      
      {displayedQuery && (
        <p style={styles.searchInfo}>Showing results for: "{displayedQuery}"</p>
      )}

      {loading && <p style={styles.loadingText}>Loading news...</p>}
      {error && <p style={styles.errorText}>Failed to fetch news: {error}</p>}

      {!loading && !error && news.length === 0 && displayedQuery && (
        <p style={styles.noResultsText}>No news found for "{displayedQuery}"</p>
      )}

      {!loading && !error && news.length > 0 && (
        <ul style={styles.newsList}>
          {news.map((article, index) => (
            <li key={index} style={styles.newsItem}>
              <h3 style={styles.newsTitle}>{article.title}</h3>
              <p style={styles.newsDescription}>{article.description}</p>
              <a href={article.url} target="_blank" rel="noopener noreferrer" style={styles.newsLink}>
                Read More →
              </a>
            </li>
          ))}
        </ul>
      )}

      {!loading && !error && news.length > 0 && (
        <button onClick={handleLoadMore} style={styles.loadMoreButton}>
          Load More
        </button>
      )}
    </div>
  );
};

export default NewsFeed;
